class Turno {
    atual;
    total;
    players;

    constructor() {
        this.players = [];
        this.atual = null;
        this.total = 0;
    }

    setAtual(atual) {
        this.atual = atual;
    }
    getAtual() {
        return this.atual;
    }

    setTotal(total) {
        this.total = total;
    }
    getTotal() {
        return this.total;
    }

    setPlayers(players) {
        this.players = players;
    }
    getPlayers() {
        return this.players;
    }

    inicioRandom(players, num) {
        let random = Math.round(Math.random() * num);
            this.atual = players[random];
    }
}

export default Turno;
